import { Controller, Scene } from "react-scrollmagic";
import { Tween, Timeline } from "react-gsap";
import StyleMain from "../Style/main";
import First from './sections/first'
import Second from './sections/second'

const Main = () => (
  <StyleMain>
    <Controller>
      <First />
    </Controller>
    <Controller>
      <Second />
    </Controller>

    <Controller>
     <Thirt />
    </Controller>
  </StyleMain>
);

export default Main;
